import React from "react";
import "../styles/store_header.css";

const StoreHeader = () => {
  return (
    <header className="store__header">
      <div className="store">
        <nav>
          <ul>
            <li>Novidades</li>
            <li>Promoções</li>
            <li>Blog</li>
            <li>Login</li>
            <li>Carrinho</li>
          </ul>
        </nav>
      </div>
    </header>
  );
};

export default StoreHeader;
